import React from "react";

import FlexBox from "./flexBox/flexBox";
import {useTranslation} from "react-i18next";
import Grid from "./grid/grid";

const FlexGrid = () => {
  const { t } = useTranslation()
  return(
    <>
      <h2>{t(`nav.flexBox`)}</h2>
      <FlexBox />
      <Grid />
    </>

  )
}

export default FlexGrid
